import getBundle from './cm3-ml-bundle';

const cm3MlPlugin=function getPlugin(){
  return(
    {
      pluginName: 'Model Library Plugin',
      enabled: true,
      bundle: getBundle(),
      components:[]
    }
  )
}

export {cm3MlPlugin as default}
